import { useState } from "react";

const AddUser = () => {
    let [name,setname]=useState("")
    let [age,setage]=useState("")
    let [email,setemail]=useState("")
    let [phno,setphno]=useState("")

    return ( 
        <div className="addUser">
            <h1>Add a new User</h1>
            <div className="form"></div>
            <form action="">
            <div className="name">
                <input type="text" value={name} onChange={(e)=>e,target.value} required placeholder="name of the user" />
            </div>
            <div className="age">
                <input type="number" required placeholder="In digits" />
            </div>
            <div className="email">
                <input type="text" required placeholder="Enter your E-mail" min={10} max={10} />
            </div>
            <div className="phno">
                <input type="tel" required placeholder="0-9 digits"/>
            </div>
            </form>
           
        </div>
     );
}
 
export default AddUser;
